import axios from "axios";
import React from "react";
import { useEffect, useState } from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import MapTwoToneIcon from "@material-ui/icons/MapTwoTone";
import Button from "@material-ui/core/Button";

function LocationCard({ element }) {
	const [mapLink, setMapLink] = useState({
		x: element.xCoord,
		y: element.yCoord,
	});
	// const [mapRedirect, setMapRedirect] = useState({});

	const url = `https://developers.onemap.sg/commonapi/convert/3414to4326?X=${mapLink.x}&Y=${mapLink.y}`;

	useEffect(() => {
		axios.get(url).then((res) => console.log(res.data));
	}, []);

	const useStyles = makeStyles({
		root: {
			margin: 20,
			height: 250,
		},
		btn: {},
	});

	const classes = useStyles();
	return (
		<Card className={classes.root}>
			<CardContent>
				<Typography gutterBottom variant="h6">
					{element.address}
				</Typography>
				<Typography variant="body1" color="textSecondary" component="p">
					Available lots: {element.availableLots}
				</Typography>
				<Typography variant="body1" color="textSecondary" component="p">
					Total lots: {element.totalLots}
				</Typography>
				<Typography variant="body1" color="textSecondary" component="p">
					Free parking: {element.freeParking}
				</Typography>
				<Typography variant="body1" color="textSecondary" component="p">
					Non season parking: {element.nonSeasonLot}
				</Typography>
			</CardContent>

			<Button
				startIcon={<MapTwoToneIcon />}
				size="large"
				color="secondary"
				className="map_btn"
			></Button>
		</Card>
	);
}

export default LocationCard;
